import { ListService } from "./list.service";
import { columns } from "./list.config.ts";
import tableMixin from '@/mixins/table.mixin';
import { TASK_STATUS } from '@/constants/brand/setting/task';
import BrandTaskDetail from '@/views/biz-modals/brand/task/detail';
import { MessageService } from '@/services/message.service';
export default {
  mixins: [tableMixin],
  name: 'PageBrandSettingShopList',
  serviceInject: function serviceInject() {
    return {
      messageService: MessageService,
      listService: ListService
    };
  },
  rxState: function rxState() {
    return {
      loading: this.listService.loading$,
      last_updated_time: this.listService.last_updated_time$,
      list: this.listService.list$,
      page: this.listService.page$
    };
  },
  computed: {
    columns: columns
  },
  modals: {
    BrandTaskDetail: BrandTaskDetail
  },
  data: function data() {
    return {
      TASK_STATUS: TASK_STATUS
    };
  },
  methods: {
    refresh: function refresh() {
      return this.listService.getList(this.$searchQuery);
    },
    onClickModal: function onClickModal(id, type) {
      this.$modalRouter.push({
        name: 'brand-task-detail',
        props: {
          task_id: id,
          popup_type: type
        },
        on: {}
      });
    },
    stopTask: function stopTask(item) {
      var _this = this;

      this.listService.stopTask(item.id).subscribe(function (res) {
        _this.messageService.success({
          content: '终止任务成功!'
        });

        _this.$router.reload();
      });
    }
  }
};
